import "core-js/modules/es6.function.name";
import Aside from '@/components/Aside.vue';
import Header from '@/components/Header.vue';
export default {
  name: 'Main',
  data: function data() {
    return {
      isCollapse: false
    };
  },
  components: {
    Aside: Aside,
    Header: Header
  },
  mounted: function mounted() {
    var that = this;

    if (that.$getCookie('key') == '') {
      that.$router.push('/');
    } else {
      // 刷新页面处理
      var data = {
        key: that.$getCookie('key')
      };
      that.$axios.post('/api/login/cookie', that.$qs.stringify(data), {}).then(function (res) {
        console.log(res, '/api/login/cookie');

        if (res.data.status) {
          that.$setCookie('key', that.$getCookie('key'), 1800);
          that.$store.commit('set_user_icon', res.data.data.icon);
          that.$store.commit('set_user_name', res.data.data.name);
        } else {
          that.$delCookie('key');
          that.$router.push('/');
        }
      }).catch(function (err) {
        that.$toast(that, 'error', '网络错误～');
        that.loading = false;
      });
    } // 实时刷新cookie


    document.addEventListener("mousemove", function () {
      if (that.$getCookie('key') != '') {
        that.$setCookie('key', that.$getCookie('key'), 1800);
      }
    });
  },
  methods: {
    onCollapse: function onCollapse(status) {
      this.isCollapse = !status;
    },
    onQuit: function onQuit() {
      this.$delCookie('key');
      this.$router.push('/');
    }
  }
};
